    <NavigationContainer>
      <Stack.Navigator>
        <Text style={styles.text}>Hammy is stinky and smelly. My Chowdie bears is also smelly</Text>
        <Stack.Screen
          name="Add Mate"
          component={AddMate1}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'gray',
    alignItems: 'center',
    justifyContent: 'center'
  },
  text: {
    color: 'white'
  }
});

export default App;



